        "rq": "ribbon", 
        "wand": "{\"basic\":{\"text\":\"ribbon\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagea1\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"ribbon\",\"entity\":\"<wiki-entry><key>ribbon<\\/key><url>http://www.hudong.com/wiki/%72%69%62%62%6F%6E?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>ribbon<\\/entry><summary>Ribbon原来出现在 Microsoft Office 2007 及 2010 的Word、Excel和Powerpoint 等组件中，后来也被运用到Windows 7的一些附加组件等其它软件中，如画图和写字板。ESRI 推出的ArcGIS Explorer 9.4也采用这种界面。它是一个收藏了命令按钮和图标的皮肤。它把命令组织成一组\\\"标签\\\"，每一组包含了相关的命令。每一个应用程序都有一个不同的标签组，展示了程序所提供的功能。在每个标签里，各种的相关的选项被组在一起。设计Ribbon的目的是为了使应用程序的功能更加易于发现和使用，减少了点击鼠标的次数。有些标签，被称为“上下文相关标签”，只当特定的对象被选择时才显示。上下文相关标签只展示那些获得焦点的对象的特定功能，在对象没有被选定的时候是隐藏的。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"ribbon\"]}", 
