        "wand": "{\"basic\":{\"text\":\"forth\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagea4\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"forth\",\"entity\":\"<wiki-entry><key>forth<\\/key><url>http://zh.wikipedia.org/wiki/Forth%E7%BC%96%E7%A8%8B%E8%AF%AD%E8%A8%80<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Forth<\\/entry><summary>Forth是六十年代末期，由Charles H. Moore发展出来在天文台使用的电脑自动控制系统及程序设计语言，允许使用者很容易组合系统已有的简单指令，定义成为功能较复杂的高阶指令。由于其结构精简、执行快速、操作方便，广为当代天文学界使用。八十年代以后，有爱用者成立Forth Interest Group在世界各地推广，并陆续在各类计算机上建立Forth系统及标准的语言。FORTH以可延伸的词典为核心，采用两个堆栈为基础的高度模块化结构，是一种将解译程序interpreting和编译程序compiling合并运用的双态系统。使用FORTH，可在编译过程中检测差错，并且逐步扩充编译程序代码。利用标准FORTH所写的程序几乎不必大修改，就能在各类计算机运作；甚至在特别设计的电脑上可以完全放弃组合语言，直接由FORTH转化成机器语言，就好像现代的Java machine。同时，使用者也可以自由使用自己定义的运算功能，加入编译器 (compiler) 中，使Forth语言更有弹性。台湾的黄大一及现旅居美国的丁陈汉荪是这方面的专材，黄大一在1980年代后期开发过两部完全使用FORTH的嵌入式系统，丁陈汉荪于2002年代即以eforth架构打通软硬体任督二脉发展完成forth芯片，并将毕生研究forth的心得于2003年代编辑成书嵌入式系统：使用eForth。forth是一种可扩展的，交互式的语言。最初为小型的嵌入式电脑设计的，现在它几乎可以在任何主流的芯片上解译和编译，甚至已有多种可直接运行forth指令的芯片。 在电子表格，专家系统，多用户数据库，和分布式实时控制系统中有广泛的应用。 表面来看，forth是一种基于堆栈的概念机。例如要计算 (3+4)*5，我们的程序就是：3 4 + 5 *。首先把3和4入堆栈，然后调用+子程序，把堆栈的最顶上两个元素取出（也就是3和4）进行加法运算，然后把结果入堆栈，然后把5入堆栈，然后调用*子程序，把最顶的2个元素，也就是7和5取出，并进行乘法运算，然后把结果入堆栈，最后的。把结果从堆栈中取出打印。事实上这是一种最简单有效的概念机。当然forth远远不止这些。最常用在内建程序，以及系统与过程控制，它也用在微电脑上。主要运用在数据搜集与处理、图形处理、专家系统，以及实时流程控制等。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"forth\"]}", 
