        "wand": "{\"basic\":{\"text\":\"mash\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagec8\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"mash\",\"entity\":\"<wiki-entry><key>mash<\\/key><url>http://www.hudong.com/wiki/%4D%41%53%48?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>MASH<\\/entry><summary>MASH （Multi Stage Noise Shaping)就是多级噪音整形技术。它将最初的量化值与原信号的误差保留下来，下一次量化时先将上次量化值与误差从原信号中减去，这样重复数次，可以将二进制信号变换为脉冲宽度调制（PWM）的信号（PWM和PDM几乎一样）还可以将量化制造的噪音推到甚高频段，从而减少可闻频段的噪音。创始者是NTT公司，但是似乎只有松下公司大量采用这种技术。现在MASH已经很少见了，但从理论上来说它是很优秀的。<\\/summary><bookmark><url>http://www.hudong.com/wiki/MASH<\\/url><name>定义<\\/name><\\/bookmark><bookmark><url>http://www.hudong.com/wiki/MASH<\\/url><name>理论<\\/name><\\/bookmark><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"mash\"]}", 
