        "wand": "{\"basic\":{\"text\":\"rabbit\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagec7\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"rabbit\",\"entity\":\"<wiki-entry><key>rabbit<\\/key><url>http://www.hudong.com/wiki/Rabbit?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>rabbit<\\/entry><summary>界： 动物界 Animalia门： 脊索动物门 Chordata纲： 哺乳纲 Mammalia目： 兔形目 Lagomorpha科： 兔科 Leporidaede Waldheim 1817。琉球兔属 Pentalagus山兔属 Bunolagus苏门兔属 Nesolagus火山兔属 Romerolagus倭兔属 Brachylagus林兔属 Sylvilagus穴兔属 OryctolagusPoelagus粗毛兔属 Caprolagus岩兔属 Pronolagus兔属 Lepus兔，俗称兔子，是哺乳类兔形目、草食性脊椎动物。兔形目：兔形目是哺乳动物的一个目，有两个科Leporidae（野兔和家兔）以及Ochotonidae（鼠兔）。兔子眼睛的颜色与它们的皮毛颜色有关系，黑兔子的眼睛是黑色的，灰兔子的眼睛是灰色的，白兔子的眼睛是透明的。那为什么我们看到小白兔的眼睛是红色的呢？这是因为白兔眼睛里的血丝（毛细血管）反射了外界光线，透明的眼睛就显出红色。兔子的眼睛有红色,蓝色,茶色等各种颜色,也有的兔子左右两只眼睛的颜色不一样.或许因为兔子是夜行动物,所以它的眼睛能聚很多光,即使在微暗处也能看到东西.另外,由于兔子的眼睛长在脸的两侧,因此它的视野宽阔,对自己周围的东西看得很清楚,有人说兔子连自己的脊梁都能看到.不过,它不能辨别立体的东西,对近在眼前的东西也看不清楚。灰兔子的眼睛是灰色的。小兔是有各种颜色的，它们的眼睛也是有不一样颜色的。那是因为它们身体里有一种叫色素的东西。含有灰色素的小兔，毛和眼睛就是灰色的；含黑色素的小兔，毛和眼睛是黑的。小白兔身体里不含色素，它的眼睛是无色的，我们看到的红色是血液的颜色，并不是眼球的颜色，所以它的眼睛自然就是红色的了。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"rabbit\"]}", 
