        "uksm": "'aɪd(ə)l", 
        "rq": "idle", 
        "wand": "{\"basic\":{\"text\":\"idle\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimageb5\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"idle\",\"entity\":\"<wiki-entry><key>idle<\\/key><url>http://www.hudong.com/wiki/Idle?prd=citiao_right_xiangguancitiao?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Idle<\\/entry><summary>Idle()功能该函数在用户每次活动（例如，按键盘、移动鼠标等）后重置定时器，n秒后触发应用对象的Idle事件。语法Idle ( n )。指定空闲时间间隔，以秒为单位。该参数的值设置为0时，停止空闲检测，不再触发应用对象的Idle事件返回值Integer。函数执行成功时返回1，此时启动定时器。如果不能启动定时器或定时器未启动而n的值指定为0时，函数返回-1。如果任何参数的值为NULL，Idle()函数返回NULL。用法利用Idle()函数，应用程序可以构造自己的屏幕保护程序，避免安全数据的泄露。当使用Idle()函数已经启动了定时器后，如果再次以非0参数调用Idle()函数，那么该函数重设时间间隔，但并不启动新的定时器。Idle()函数启动定时器后，如果在指定的时间间隔（从用户最近一次操作算起）内没有操作应用程序，那么就触发应用对象的Idle事件，在这个事件中可以编写关闭窗口、退出数据库登录等一系列代码，然后使用Restart()函数重新启动应用程序，起到保密的目的。发生下述任何情况时，系统自动重置定时器（即重新开始计时）：n 用户在该应用程序的任何窗口内移动鼠标或单击鼠标（双击鼠标时首先触发单击事件）n 在该应用程序的某个窗口是当前窗口时用户按下了任意一个或多个键n 在该应用程序的窗口最小化时，用户在该应用的图标上单击鼠标或移动鼠标n 在该应用程序的窗口最小化并且该应用程序是当前应用程序（应用名称被加亮显示）时，用户按了任何按键n 可视数据窗口检索数据时引起的编辑控件（指漂浮在数据窗口当前行/列上的编辑控件）重绘操作。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"idle\"]}", 
