        "rq": "lip", 
        "wand": "{\"basic\":{\"text\":\"lip\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimageb4\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"lip\",\"entity\":\"<wiki-entry><key>lip<\\/key><url>http://www.hudong.com/wiki/Lymphocytic%20interstitial%20pneumonia?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>淋巴细胞间质性肺炎<\\/entry><summary>淋巴细胞间质性肺炎（Lymphocytic interstitial pneumonia，简称LIP）是指肺间质（肺泡间隔、血管壁及支气管壁）内有成熟的小淋巴细胞弥漫性浸润，夹杂少量浆细胞和组织细胞的一种慢性良性疾病，无肺内淋巴结病变和坏死。LIP与假性淋巴瘤的组织学结构相似，因此，某些学者将其称之为弥漫性淋巴细胞间质性肺炎或弥漫性淋巴组织样增生（diffase lymphoidhyperplasia），以避免与肺假性淋巴瘤混淆。本病见于免疫缺陷病人，主要是HIV感染小儿。除AIDS病外，成人多伴有慢性活动性肝炎、系统性红斑狼疮、甲状腺炎、自家免疫溶血性贫血、重症肌无力等。<\\/summary><thumbUrl>http://www.youdao.com/glimpse/thumb?docid=845AF296CC2ED026<\\/thumbUrl><wikiType>unknown<\\/wikiType><\\/data><\\/info><photoUrl>http://tupian.hudong.com/s/lip/xgtupian/1/0?hf=youdaocitiao&amp;pf=youdaocitiao<\\/photoUrl><\\/wiki-entry>\",\"queries\":[\"lip\"]}", 
