        "rq": "twinkle", 
        "wand": "{\"basic\":{\"text\":\"twinkle\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagec6\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"twinkle\",\"entity\":\"<wiki-entry><key>twinkle<\\/key><url>http://www.hudong.com/wiki/twinkle?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Twinkle<\\/entry><summary>Twinkle。：宠物养成+竞速休闲。：Reveal。：。：http://twinkle.mupoh.jp/《Twinkle》是一款3D卡通养成竞速游戏。游戏融合了宠物养成,竞赛对战等流行要素，并且人物形象可爱，上手难度较低，游戏节奏轻快比较适合女性以及低年龄用户。　背景故事：　　在宇宙中，有一个叫做阿鲁克的星系。在那里诞生了一些完全联想不到的技术革新 。首先是交通工具的革新。在星体碎片里，如果注入一种特殊的气体，星体碎片马上就变成飞行工具。这项技术的发明者一个叫做Enzo Twinkle的怪人。这位怪人同时也是Twinkle Motor Corp.公司，一代大财阀的创始人。在阿鲁克的4个地域里，走在时代尖端的新兴财阀“Oligalbi”公司。用生物素材来制作Cyber服的“阿迩玛尼”公司，从植物的蛋白质中发明了无氧炸弹的“kinomi”公司，经营宇宙中所有主题公园的“Characti.Corp”公司。这四家财团构成了阿鲁克星系里前所未有的经济大景气。　　在4大财阀中，每个财阀都有着自己漂亮的儿女。他们穿着阿迩玛尼制的名牌服饰，在深夜的晚会中驾驶着他们的《Twinkle》不停的攀比着自己的衣服和道具。突然有一天，这个地域发生了一系列不明的重力异常现象。接着就是一连串Twinkle缺陷事件。Twinkle Motor Corp.公司也因此一崛不正。由这事件的影响，阿鲁克星系的经济状况开始恶化，人们的把自己的“Twinkle”卖给二手车“Arugomiku Market”后，就纷纷的移居到别的星系去了。那4家庞大的财团，也因此走向没落。　　时光转移，在荒废的阿鲁克星里，迷之富豪Dr.T开始主办宇宙最快飑车比赛“Space I”。而且优胜奖品就是那个流失多年的Twinkle Motor Corp.公司的家宝。再仔细看，奖品竟然都是以前旧财阀留下的遗物。“啊，不会吧！”对于那些没落的孩子们来说“Space I”是夺回自己财产，回到过去生活的最好时机。Twinkle MotorCorp的女儿，Momoka也被邀请，决定来参加这次比赛。<\\/summary><thumbUrl>http://www.youdao.com/glimpse/thumb?docid=23E998B13DBBC026<\\/thumbUrl><wikiType>unknown<\\/wikiType><\\/data><\\/info><photoUrl>http://tupian.hudong.com/s/twinkle/xgtupian/1/0?hf=youdaocitiao&amp;pf=youdaocitiao<\\/photoUrl><\\/wiki-entry>\",\"queries\":[\"twinkle\"]}", 
