        "wand": "{\"basic\":{\"text\":\"cog\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimageb3\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"cog\",\"entity\":\"<wiki-entry><key>cog<\\/key><url>http://www.hudong.com/wiki/Cog?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>COG<\\/entry><summary>是Cluster of Orthologous Groups of proteins（蛋白相邻类的聚簇）的缩写。构成每个COG的蛋白都是被假定为来自于一个祖先蛋白，并且因此或者是orthologs或者是paralogs。Orthologs是指来自于不同物种的由垂直家系（物种形成）进化而来的蛋白，并且典型的保留与原始蛋白有相同的功能。Paralogs是那些在一定物种中的来源于基因复制的蛋白，可能会进化出新的与原来有关的功能。请参考文献获得更多的信息。什么是COG？ 　　“COG”是Cluster of Orthologous Groups of proteins（蛋白相邻类的聚簇）的缩写。构成每个COG的蛋白都是被假定为来自于一个祖先蛋白，并且因此或者是orthologs或者是paralogs。Orthologs是指来自于不同物种的由垂直家系（物种形成）进化而来的蛋白，并且典型的保留与原始蛋白有相同的功能。Paralogs是那些在一定物种中的来源于基因复制的蛋白，可能会进化出新的与原来有关的功能。请参考文献获得更多的信息。<\\/summary><bookmark><url>http://www.hudong.com/wiki/COG<\\/url><name>“COG”<\\/name><\\/bookmark><bookmark><url>http://www.hudong.com/wiki/COG<\\/url><name>COG是如何建立的？<\\/name><\\/bookmark><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"cog\"]}", 
