        "rq": "thrash", 
        "wand": "{\"basic\":{\"text\":\"thrash\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagec6\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"thrash\",\"entity\":\"<wiki-entry><key>thrash<\\/key><url>http://www.hudong.com/wiki/thrash?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Thrash<\\/entry><summary>Thrash（鞭挞金属）。鞭鞑金属本质上就是80年代的地下重金属乐，它主要使用一种用于节奏吉他的推进性的敲击方法（多亏了手掌闷音这一技巧的产生及运用），具有很强的攻击性。鞭鞑金属通常具有吉他技术娴熟、节奏快而狠的特点，有时还会用无调的吉他连复段代替旋律。但是以上这些概括远不是绝对的标准。早期的时候，鞭鞑金属从本质上看和速度金属是一样的，80年代早期美国乐队的作品就将英国重金属新浪潮简洁凶狠的敲击，以及硬核朋克与摩托党的节奏混合在了一起。但是，演奏速度金属所要求的灵敏性和持续的强度渐渐成为其局限，于是各种各样不同的技巧迅速地成形了：有一些鞭鞑金属乐队集中精力于中速的反复乐句，偶尔加快速度进入到速度金属的范围；还有一些，比如 Metallica 和 Megadeth, 用他们高超的吉他技巧创作出了更复杂更前卫的音乐；剩下的一些则注重音乐的侵略性，用以塑造一种戏剧性的恐吓的意境。对于80年代末期控制了排行榜的易被人接受的流行金属乐队来说，鞭鞑金属提供了一种更硬、更重、更可以确切地称之为金属的音乐选择；所以尽管缺乏在电台上的反复播送，鞭鞑金属依然变得非常受欢迎，以至于90年代早期 Metallica 和 Megadeth 只是将他们的音乐稍做改进使之更容易被接受，他们就迅速地称为了超级明星。而地下金属头目中的顽固分子则在这次鞭鞑金属引发的死亡与黑金风格中找到了避难所，他们把鞭鞑金属中黑暗的主题和内在的爆发力借鉴过来，并有意地将之发展成为了烦扰的极端事物。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"thrash\"]}", 
