        "rq": "Julius", 
        "wand": "{\"basic\":{\"text\":\"julius\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagea1\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"julius\",\"entity\":\"<wiki-entry><key>julius<\\/key><url>http://www.hudong.com/wiki/Julius?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>JULIUS<\\/entry><summary>Julius聚利时，来自韩国的流行手表品牌，从登陆中国大陆开始就受到潮流女性、时尚白领的追捧，引领了国内时尚手表的风云变革，更掀起了热浪般的抢购风潮，这不仅仅因为我们在国内拥有众多中韩设计师，她们巧妙的把“韩流”元素与中国特色天衣无缝的完美结合，更重要的是因为我们坚持高品质，我们认为质量和时尚元素同样重要，因此每支标注有“Julius”品牌的手表均为一件不可多得的艺术品。<\\/summary><thumbUrl>http://www.youdao.com/glimpse/thumb?docid=B9B23821A10116EF<\\/thumbUrl><wikiType>unknown<\\/wikiType><\\/data><\\/info><photoUrl>http://tupian.hudong.com/s/julius/xgtupian/1/0?hf=youdaocitiao&amp;pf=youdaocitiao<\\/photoUrl><\\/wiki-entry>\",\"queries\":[\"julius\"]}", 
