        "rq": "origin", 
        "wand": "{\"basic\":{\"text\":\"origin\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagec5\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"origin\",\"entity\":\"<wiki-entry><key>origin<\\/key><url>http://www.hudong.com/wiki/%6F%72%69%67%69%6E?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>origin<\\/entry><summary>Origin是由OriginLab公司开发的一个功能普通寻常的科学绘图、数据分析软件，支持在Microsoft Windows下运行。 Origin支持各种各样的2D/3D图形。 Origin中的数据分析功能包括统计，信号处理，曲线拟合以及峰值分析。Origin中的曲线拟合是采用基于Levernberg-Marquardt算法（LMA）的非线性最小二乘法拟合。 Origin强大的数据导入功能，支持多种格式的数据，包括 ASCII , Excel, NI TDM, DIADem, NetCDF, SPC，等等。图形输出格式多样，例如JPEG，GIF，EPS，TIFF等。内置的查询工具可通过ADO访问数据库数据。<\\/summary><thumbUrl>http://www.youdao.com/glimpse/thumb?docid=35D07FFC2F166B48<\\/thumbUrl><wikiType>unknown<\\/wikiType><\\/data><\\/info><photoUrl>http://tupian.hudong.com/s/origin/xgtupian/1/0?hf=youdaocitiao&amp;pf=youdaocitiao<\\/photoUrl><\\/wiki-entry>\",\"queries\":[\"origin\"]}", 
