        "uksm": "klæmp", 
        "rq": "clamp", 
        "wand": "{\"basic\":{\"text\":\"clamp\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagea1\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"clamp\",\"entity\":\"<wiki-entry><key>clamp<\\/key><url>http://www.hudong.com/wiki/CLAMP?prd=citiao_right_xiangguancitiao?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>CLAMP<\\/entry><summary>CLAMP是日本漫画家4人组合的笔名。CLAMP是一个全部由女性成员组成的漫画工作室从1989年正式出道的。在当时看来，就只是一个漫友俱乐部。然而几经吐纳、锤炼，现在的CLAMP实际上只由四人组成：大川绯芭（原名大川七濑，后改为大川绯芭）(Nanase Ohkawa)、五十岚寒月（satsukiIgarashi)、猫井椿(Mick Nekoi)、摩可那(Mokona Apapa)。其中摩可那负责分格和做画,接下来五十岚寒月负责画框线和贴网点纸,而画稿最终由猫井椿完成。大川绯芭小姐曾经在早稻田大学文学系研读（并非正式毕业于早稻田）,在CLAMP中负责剧本创意,是CLAMP中的灵魂人物。<\\/summary><thumbUrl>http://www.youdao.com/glimpse/thumb?docid=23D83D133F8B3A7D<\\/thumbUrl><wikiType>unknown<\\/wikiType><\\/data><\\/info><photoUrl>http://tupian.hudong.com/s/clamp/xgtupian/1/0?hf=youdaocitiao&amp;pf=youdaocitiao<\\/photoUrl><\\/wiki-entry>\",\"queries\":[\"clamp\"]}", 
