        "wand": "{\"basic\":{\"text\":\"surrender\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimageb5\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"surrender\",\"entity\":\"<wiki-entry><key>surrender<\\/key><url>http://www.hudong.com/wiki/surrender?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Surrender<\\/entry><summary>DJ：The Chemical Brothers专辑：Surrender 风格：Big Beat公司：Astralwerks时间：1999。他们在电子乐领域里的巨大成功不仅在于他们娴熟的技巧、敢于创新、实验性的探索、广泛的取材，关键是他们源源不断的音乐灵感和全新观念。 十年前，Tom Rowlands和Ed Simon在大学里结识，想不到当年这两位年轻人所却导致日后触发起一场名为Big Beat的电子音乐浪潮。 1995年的首张专辑Exit Planet Dust出版发行，Exit Planet Dust是The Chemical Brothers在原创性上的代表作，然而Dig Your Own Hole，却是得以让他们的声音拓展到更深层、更广阔的层面上，成绩比前作更辉煌。在这张《Surrender》里Chemical Brother做出的不是那些被玩烂了的big beat那样爆裂宣泄、让人的心脏急速充血、带来强烈的感官刺激的玩艺儿，而是非常优美、迷幻、层层变化的音乐，这次Chemical Brother请来了老牌电子组合New Order的Bernard Sumner、Oasis主唱Noel Gallagher、Mazzy Star主唱Hope Sandoval、Mercury Rev主唱Jonathan Donahue以及Primal Scream的Bobby Gillespie共同演绎，精英汇聚、给足了Chemical Brothers面子。 专辑中Out Of Control是典型的Techno/House，作品灵感来自New Order 的经典之作Blue Monday，而OrangeWedge是60年代迷幻音乐的90年代电子版，当年迷幻失真吉他效果变成了电子化的fuzz音效。另一首佳作Got Glint?则带有明显早期底特律Techno味道。尤其Hope在Asleep From Day中迷离冰凉的演唱，将太空飘浮感的作品带入了深冷、虚幻的区域，好像一场梦境：迷幻、阴郁、诡异。而Dream On中的梦境则更为甜美、自然。 Chemical Brothers在音乐题材和元素上又作了尝试，他们勇于演绎各种摇滚风格的音乐并用他们丰富的想象力逐步成为电子乐的王尊！　　之前的专辑Exit Planet Dust和Dig Your Own Hole除了让Big Beat音乐立下里程碑，亦奠定了化学兄弟在电子乐乐坛的地位。不过这也代表着， Big Beat已经不是什么新鲜玩意。99年的Surrender开始走以往主流的舞曲路线，减少了Big Beat/Breakbeat的使用，增加了80年代4/4拍的Euro Dance、Electro与House元素，甚至连主打Hey Boy Hey Girl都是Techno作品。　　开场曲Music: Response一开始便是浓浓的复古味，简单的合成音色和vocoder效果器，但在节奏上仍有些许的Big Beat味道。接连的Under The Influence马上变成4/4拍的House舞曲，很容易看出化学兄弟做改变的尝试。Out Of Control有在八零年代十分红的Bernard Sumner (New Order乐团)与Bobby Gillespie (Primal Scream乐团)一同参与制作，4/4拍的舞曲风格自然也不是化学兄弟以往的作风，Bernard Sumner亦在本曲中秀了一段吉他间奏。　　和以往的专辑一样，每张专辑中至少都会有一首速度较平缓的演奏曲，Orange Wedge在这便是如此的作品。Let Forever Be再度请到了Oasis的Noel Gallagher助唱，但听起来实在很像Dig Your Own Hole中的Setting Sun。The Sunshine Underground经由将近4分钟的铺陈，由慢速的迷幻曲风渐渐变成两倍速度快的4/4拍舞曲。原本老是给人有乡村味感觉的Beth Orton，这次在Asleep From Day中被民谣团体Mazzy Star女主唱Hope Sandoval代替。　　Got Glint?回到复古的House曲风，而主打曲Hey Boy Hey Girl出奇的迷幻Techno曲风还真令人有点讶异，不过从Exit Planet Dust到Surrender也有了四年，也是该换换跑道的时候了。把主打曲放在专辑这么后面似乎也是第一次。专辑同名曲Surrender听起来倒是没什么特别，音乐的重复性颇高。最后的Dream On有点像Dig Your Own Hole中The Private Psychedelic Reel的角色，亦是走迷幻曲风，但加入了空心吉他演奏。　　The Chemical Brothers 99年新碟.相较于前两张专辑,Surrender减少了Big-Beat/Breakbeat的节拍,而 增加了4/4拍的拍子.不过虽然Big-Beat的感觉减少了,但还是听得出来The Chemical Brothers结合摇滚乐 与电子乐的意味.专辑第一支单曲Hey BoyHeyGirl是高压的AcidTechno,有着诡异的气氛;专辑开场曲Music:Response听起来像复古的Electro;Out Of Control 有New Order的Bernard Sumner和Primal Scream(原始呐喊)的BobbyGillespie共同参与,也是首较偏Techno 的作品,而且曲子后半的旋律很迷幻;Let ForeverBe再度请到了Oasis的Noel Gallasher 助唱,不过没啥新意就是了.最后一首Dream On是首摇篮曲(The Chemical Brothers自己表示) ,但仍有著名显的节奏感,也加入了空心吉他演奏.我自己喜欢的一首是The Sunshine Undrrground, 这首曲子的旋律又迷幻又美妙,先以Brit-Hop节拍带入,但后来却转成快速的4/4拍.　　听Chemical Brothers的音乐有一种非常强烈的感觉，那就是急促。听这张新专辑Surrender，还会有一种感觉，那就是乱花渐欲迷人眼。从早期的迷幻音乐色彩到80年代芝加哥的house beat，从诡异多变的电子音效到容纳传统摇滚乐风格的演绎手法，不能不佩服Tom Rowlands和Ed Simons的兄弟俩的化学功底。　　Chemical Brothers一向爱搞强强联合，这次也不例外。列出嘉宾的名单能吓人一跳：老牌电子组合New Order的Bernard Sumner、Oasis主唱Noel Gallagher、Mazzy Star主唱Hope Sandoval、Mercury Rev主唱Jonathan Donahue以及Primal Scream的Bobby Gillespie。兄弟的号召力非同一般。　　由于各路高手加盟，专辑从整体上讲已不是纯粹的电子乐，确切地讲是一种电子摇滚。这样，专辑中就分成两部分，一部分是由兄弟俩操刀的作品，这几首作品电子化十足，这集中体现在前3首作品上，Music: Response/Out Of Control/Under The Influence连接得相当紧密，一气呵成，诡异、迷乱、急促、花哨。Out Of Control灵感来自New Order 的经典之作Blue Monday， Bernard Sumner 为这首歌助阵再合适不过。8分钟长的The Sunshine Underground前半部分是ambient效果音乐，后半部分是一首绝佳的弱拍舞曲。Orange Wedge是60年代迷幻音乐的90年代电子版，当年迷幻失真吉他效果变成了电子化的fuzz音效。另一首佳作Got Glint?则带有明显早期底特律Techno遗风。另一部分是在嘉宾上演的曲目中，Chemical Brothers把自己放在次要位置，尽可能让客串的人喧宾夺主。因此在Hope Sandoval演唱的Asleep From Day、 Noel Gallagher 演唱的Let Forever Be和Jonathan Donahue演唱的Dream On这几首歌中，基本上都保持了演唱者原有的特色。Asleep From Day迷幻、阴郁、诡异，带着阵阵催眠效果；Let Forever Be是典型的Oasis是的风格，同时也带点the Beatles的影子，旋律相当上口；Dream On与现在的Mercury Rev风格一致，Mercury Rev去年的专辑在英国获得了令人意外的好评，Donahue奉献的这首片尾曲，画面感强，颇值回味。　　Chemical Brothers是一个非常聪明的电子组合，论技巧、论实验色彩，在电子圈中数一数二，但他们并没有因此吃偏食，他们更乐于演绎各种摇滚风格的音乐。与上一张相比，Surrender更成熟、更好听。曲目：1.Music:Response　 2.Under The Influence 3.Out Of Control 4.Orange Wedge 5.Let Forever Be 6.The Sunshine Underground 7.Asleep From Day 8.Got Glint?　 9.Hey Boy Hey Girl 10.Surrender 11.Dream On。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"surrender\"]}", 
