g在对象上将对象的新内容进行来回移动以便覆盖原始内容。方法方法描述addBehavior给元素附加一个行为。appendChild给对象追加一个子元素。applyElement使得元素成为其它元素的子元素或父元素。attachEvent将指定函数绑定到事件，以便每当该事件在对象上触发时都调用该函数。blur使元素失去焦点并触发onblur事件。clearAttributes从对象中删除全部标签属性和值。click触发onclick事件来模拟单击。cloneNode从文档层次中复制对对象的引用。componentFromPoint通过特定事件返回对象在指定坐标下的位置。contains检查对象中是否包含给定元素。detachEvent从事件中取消指定函数的绑定，这样当事件触发时函数就不会收到通知了。doScroll模拟对滚动条组件的单击。dragDrop初始化拖曳事件。fireEvent触发对象的指定事件。focus使得元素得到焦点并执行由onfocus事件指定的代码。getAdjacentText返回邻接文本字符串。getAttribute获取指定标签属性的值。getAttributeNode获取由attribute.name属性引用的attribute对象。getBoundingClientRect获取指定TextRectangle对象集合绑定的对象。getClientRects获取描述对象内容或客户区内布局的矩形集合。每个矩形都描述了一条直线。getElementsByTagName获取基于指定元素名称的对象集合。getExpression获取给定属性的表达式。hasChildNodes返回表明对象是否有子对象的值。insertAdjacentElement在指定位置插入元素。insertAdjacentHTML在指定位置的元素中插入给定的HTML文本。insertAdjacentText在指定位置插入给定的文本。insertBefore在文档层次中插入元素。mergeAttributes复制所有读/写标签属性到指定元素。normalize合并邻接TextNode对象以便生成一个常规的文档对象模型。releaseCapture释放当前文档中对象的鼠标捕捉。removeAttribute删除对象的给定标签属性。removeAttributeNode从对象中删除删除attribute对象。removeBehavior分离元素的行为。removeChild从元素上删除子结点。removeExpression从指定属性中删除表达式。removeNode从文档层次中删除对象。replaceAdjacentText替换元素的邻接文本。replaceChild用新的子元素替换已有的子元素。replaceNode用其它元素替换对象。scrollIntoView将对象滚动到可见范围内，将其排列到窗口顶部或底部。setActive设置对象为当前对象而不将对象置为焦点。setAttribute设置指定标签属性的值。setAttributeNode设置attribute对象为对象的一部分。setCapture设置属于当前文档的对象的鼠标捕捉。setExpression设置指定对象的表达式。swapNode交换文档层次中两个对象的位置。对象对象描述currentStyle代表了在全局样式表、内嵌样式和HTML标签属性中指定的对象格式和样式。runtimeStyle代表了居于全局样式表、内嵌样式和HTML标签属性指定的格式和样式之上的对象的格式和样式。style代表了给定元素所有可能的内嵌样式的当前设置。样式样式标签属性样式属性描述ACCELERATORaccelerator设置或获取表明对象是否包含快捷键的字符串。backgroundbackground设置或获取对象最多五个独立的背景属性。background-attachmentbackgroundAttachment设置或获取背景图像如何附加到文档内的对象中。background-colorbackgroundColor设置或获取对象内容后的颜色。background-imagebackgroundImage设置或获取对象的背景图像。background-positionbackgroundPosition设置或获取对象背景的位置。background-position-xbackgroundPositionX设置或获取backgroundPosition属性的x坐标。background-position-ybackgroundPositionY设置或获取backgroundPosition属性的y坐标。background-repeatbackgroundRepeat设置或获取对象的bac