        "wand": "{\"basic\":{\"text\":\"brew\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimageb7\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"brew\",\"entity\":\"<wiki-entry><key>brew<\\/key><url>http://www.hudong.com/wiki/%62%72%65%77?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>BREW<\\/entry><summary>无线二进制执行环境（Binary Runtime Environment for Wireless，简称BREW）为2001年美国高通（Qualcomm）公司所设计提出的3G系统最佳平台解决方案，可支援cdmaOne／CDMA2000／GSM／GPRS／UMTS／WCDMA，技术上横跨电信、软件开发、手机厂等三大领域，在编程语言支援方面，BREW可让使用C/C++语言开发的应用拥有更好的运行效能，同时它还支援其他开发语言，包括Java、XML和Flash等。目前有美国Verizon Wireless、中国电信、日本KDDI、韩国KTF、泰国Hutchison cat、澳洲Telstra、墨西哥Iusacell、印度Tata、巴西VIVO、阿根廷Movicom、以色列Pelephone、委内瑞拉的Telcel、乌拉圭的Movicom……等数十家电信业者采用。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"brew\"]}", 
