        "rq": "invisible", 
        "wand": "{\"basic\":{\"text\":\"invisible\",\"pos\":-1,\"type\":{\"id\":\"wiki\",\"name\":\"百科\",\"xslt\":\"wiki.xsl?_=20150814\"},\"oimage\":\"oimagea2\",\"user\":\"27ea057a1166e21b0\"},\"key\":\"invisible\",\"entity\":\"<wiki-entry><key>invisible<\\/key><url>http://www.hudong.com/wiki/invisible?amp;pf=youdaocitiao&amp;hf=youdaocitiao?hf=youdaocitiao&amp;pf=youdaocitiao<\\/url><info><dataType>wiki-page<\\/dataType><data><entry>Invisible<\\/entry><summary>专 辑：Invisible 歌 手：叶树茵 语 言：国语专辑1CD 公 司：科艺百代 日 期：2005.10.14。睽违十年等待 全新创作专辑　　叶树茵首次美背演出 王菲韵味重现江湖　　时隔 11 年，叶树茵终于要发新专辑了！距离上一张专辑 1994 年的“非常属于我”实在太久了，虽然她一直还有在唱，但大多数人其实并不知道，对他们来说，她或许是个仅仅存在于记忆之中的名字，也或许是场早就放弃的痴心等待，但是这个秋天突如其来地，我们终于又将可以听见叶子的声音……　　重新认识叶树茵就从叶树茵“数叶集”开始，当大家对叶树茵的印象还是停留在唱歌轻轻柔柔的、总是很安静的坐在某一个角落的小女人的时候。叶树茵改变了，变成一个对自己有自信的女性音乐人。虽然在未发片的六年间，她也经过了际遇不顺遂的试炼，每当错失可以发片的机会时，她总是再继续往前走，继续她的音乐创作的旅程，偶尔在“女巫店”发表她的新创作。⊙翻新华语电音新印象 10 等待真正认识叶树茵★ Invisible　　勾魂设魄主打：唱出每个人心里最无形的感受 害怕、不安、怀疑★ Answer Me　　熟男熟女主打：张翰魅力演出 树茵演技挑战　　“2005海洋影展入围 MV” 演、唱难度大考验★ 消失　　春上村树主打：文艺气质 无人能比 K 歌新选择。<\\/summary><wikiType>unknown<\\/wikiType><\\/data><\\/info><\\/wiki-entry>\",\"queries\":[\"invisible\"]}", 
